import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import FolderIcon from '@material-ui/icons/Folder';
import RestoreIcon from '@material-ui/icons/Restore';
import FavoriteIcon from '@material-ui/icons/Favorite';
import SearchIcon from '@material-ui/icons/Search';

const useStyles = makeStyles({
  root: {
    width: '100%',
  },
});

export default function LabelBottomNavigation() {
  const classes = useStyles();
  const [value, setValue] = React.useState('recents');

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div className="footer">
      {/* Add component = {Link} into BottomNavAction  */}
      <BottomNavigation value={value} onChange={handleChange} className={classes.root}>
        <BottomNavigationAction  to="#" label="Recents" value="recents" icon={<RestoreIcon />} />
        <BottomNavigationAction  to="#" label="Favorites" value="favorites" icon={<FavoriteIcon />} />
        <BottomNavigationAction  to="#" label="Nearby" value="nearby" icon={<SearchIcon />} />
        <BottomNavigationAction  to="#" label="Folder" value="folder" icon={<FolderIcon />} />
      </BottomNavigation>
    </div>
  );
}
